import React, {Fragment} from 'react';
import Header from './components/Header';

function App() {
  return (
    <Fragment>
      <Header titulo='Clima React'/>

      <div className="contenedor-form">
        <div className="container"></div>

      </div>
    </Fragment>
  );
}

export default App;
